void spi_init()
{
  DDRB |= _BV(PB2) | _BV(PB3) | _BV(PB5); // Ustaw pin CS, MOSI, SCK na output
  PORTB |= _BV(PB2); // CS pocztkowo wysokie

  SPCR |= _BV(SPR0); // 1MHz
  SPCR |= _BV(MSTR); // Ustaw master jako SPI
  SPCR |= _BV(SPE); // Wcz SPI
}

void send_sample(uint8_t sample)
{
  uint8_t data1 = 0x30 | (sample >> 4);
  uint8_t data2 = sample << 4;

  PORTB &= ~_BV(PB2); // Ustaw CS na niski, rozpocznij transmisj
  SPDR = data1;
  loop_until_bit_is_set(SPSR, SPIF);  // Przesyanie pierwszego bajtu
  SPDR = data2;
  loop_until_bit_is_set(SPSR, SPIF);  // Przesyanie drugiego bajtu
  PORTB |= _BV(PB2); // Ustaw CS na wysoki, zakocz transmisj
}


int main()
{
  spi_init();

  while(1){
    for(uint16_t i = 0; i < 14675; i++){
      send_sample(pgm_read_byte(&samples[i]));
      _delay_us(125);
    }
  }

}